INSERT INTO `about_us` (`id`, `title`, `sub_title`, `video`, `type`, `desc`, `created_at`, `updated_at`) VALUES
(5, 'UNMATCHED CONCEPT', 'CHALLENGING YET ENERGIZING', NULL, 'image', 'At Sky Park, your courage will be put to test. Nothing can satisfy your lust for adventure as a set of professional obstacle courses elevated on three levels. and the higher up you go, the more challenging it will get. So, take a deep breath and set your sails towards Sky Park to prove yourself the ultimate champ. Obstacle courses are established on four levels, Junior, Novice, Intermediate, and Expert. Each path goes another level higher than the one before and features some more challenging obstacles. No, we didn’t forget about our little ones. Children up to 5 years old have their own special route with obstacles tailored to match their age. Once you succeed to complete your mission and reach the finish line, your lips won’t refrain from keeping a smile on hold for the next couple of days.', '2022-03-06 06:10:40', '2022-03-06 06:10:40'),
(10, 'SELF ACCOMPLISHMENT IS', 'OUR PHILOSOPHY', 'assets/uploads/about_us/66171646554047.mp4', 'video', 'Diamonds are formed through millions of years of intense heat and pressure, but watch how they came out to be. It’s just the same with humans, we always learn and come out better after passing through hardships and overcoming them. That’s what we aim at spreading through Sky Park. Once you decide to cling your harness to the course, there’s only one way down and that’s right at the end of your path. But as soon as you overcome your challenge you won’t be the same person who came up; A new, more joyful, more confident being who is always willing to take the risk and prove to himself that he is stronger.', '2022-03-07 10:26:46', '2022-03-06 06:07:27');
INSERT INTO `activities` (`id`, `title`, `sub_title`, `photo`, `desc`, `created_at`, `updated_at`) VALUES
(2, NULL, 'EXPERT ?', 'assets/uploads/activities/46181646040595.jpg', 'Are you brave enough to walk on some wooden logs supported with nothing but a pair of ropes, or hang on a climbing wall at a height of around 30 meters? One thing is certain to be said, this course is not for the faint-hearted, but once you get it over with, nothing more can stand in your way.', '2022-03-28 09:23:18', '2022-02-28 09:29:55'),
(3, 'OR JUST', 'SKILLED ?', 'assets/uploads/activities/29401646040675.jpg', 'This course is designed to put your physical and mental skills up to the test. A challenge that would make your mind erupt with joy and your heart with pleasure. Your knees might be shaking but a smile is certain to stay put on your face.', '2022-03-27 09:23:18', '2022-02-28 09:31:15'),
(4, 'MAYBE YOU\'RE A', 'NOVICE ?', 'assets/uploads/activities/36491646040722.jpg', 'If you are still a newbie when it comes to climbing and hanging on ropes, or if you just need a warmup prior to going rough. the orange course is your best choice. Here, you can test your skills before going wild on a tougher and higher level.', '2022-03-26 09:23:18', '2022-02-28 09:32:02'),
(5, 'I AM JUST A', 'JUNIOR  !', 'assets/uploads/activities/71351646040771.jpg', 'Who said adventure is only for adults?! Sky Park has a special course designed with our little, beloved ones in mind, offering them the same challenging experience but with a touch of simplicity.', '2022-03-25 09:23:18', '2022-02-28 09:32:51');
