INSERT INTO `general_settings` (`id`, `capacity`, `logo`, `title`, `rev_tax`, `family_tax`, `terms`, `about`, `address`, `phone`, `Team_phone`, `group_organization_phone`, `info_email`, `sales_email`, `twitter`, `facebook`, `instagram`, `snap`, `created_at`, `updated_at`) VALUES
(1, 1250, 'assets/uploads/46121646213984.png', 'Sky Park', 14, 14, 'At Sky Park, your courage will be put to test. Nothing can satisfy your lust for adventure as a set of professional obstacle courses elevated on three levels. and the higher up you go, the more challenging it will get. So, take a deep breath and set your sails towards Sky Park to prove yourself the ultimate champ.\r\n\r\nObstacle courses are established on four levels, Junior, Novice, Intermediate, and Expert. Each path goes another level higher than the one before and features some more challenging obstacles. No, we didn’t forget about our little ones. Children up to 5 years old have their own special route with obstacles tailored to match their age. Once you succeed to complete your mission and reach the finish line, your lips won’t refrain from keeping a smile on hold for the next couple of days.', 'At Sky Park, your courage will be put to test. Nothing can satisfy your lust for adventure as a set of professional obstacle courses elevated on three levels. and the higher up you go, the more challenging it will get. So, take a deep breath and set your sails towards Sky Park to prove yourself the ultimate champ.\r\n\r\nObstacle courses are established on four levels, Junior, Novice, Intermediate, and Expert. Each path goes another level higher than the one before and features some more challenging obstacles. No, we didn’t forget about our little ones. Children up to 5 years old have their own special route with obstacles tailored to match their age. Once you succeed to complete your mission and reach the finish line, your lips won’t refrain from keeping a smile on hold for the next couple of days.', 'Westown hub،, Beverly Hills,Al-Sheikh Zayed, Giza Governorate', '01223303786', '(+20) 105-080-9110', '(+20) 1061844465', 'info@skypark.fun', 'sales@skypark.fun', 'https://www.twitter.com', 'https://www.facebook.com', 'https://www.instagram.com', 'https://www.snap.com', NULL, '2022-03-13 06:52:17');
