INSERT INTO `offer_items` (`id`, `title`, `photo`, `desc`, `offer_id`, `created_at`, `updated_at`) VALUES
(1, 'JUNIOR', 'assets/uploads/offers_items/95801646047407.jpeg', 'Who said adventure is only for adults?! Adventure is more important for juniors now more than ever, and that is all to help them disconnect from the world of technology and reunite with their playful exploratory nature. Obstacle courses specifically have their way of teaching them how to look for quick solutions to overcome each obstacle and enhance their feeling of self-confidence. Finally, a simple clap from the proud crowd will enrich their self-esteem and sense of accomplishment. Sky Park has a special course designed with our little, beloved ones in mind, offering them the same challenging experience but with a touch of simplicity.', 1, '2022-02-28 11:23:27', '2022-02-28 11:23:27'),
(2, 'NOVICE', 'assets/uploads/offers_items/18191646047544.jpg', 'If you are still a newbie when it comes to climbing and hanging on ropes, or if you just need a warmup prior to going rough. the orange course is your best choice, as it has a set of 10 beginner-level obstacles placed at only a height of 2 meters away from the ground level. Here, you can test your skills before going wild on a tougher and higher level. The orange course is ideal for children and older people who might have some fear of heights.', 1, '2022-02-28 11:25:44', '2022-02-28 11:25:44'),
(3, 'SKILLED', 'assets/uploads/offers_items/6671646047600.jpg', 'This course is designed to put your physical and mental skills up to the test. Once you climb up, there’s only one way down and that’s right at the end of your path. A challenge that would make your mind erupt with joy and your heart with pleasure. Your knees might be shaking but a smile is certain to stay put on your face. And when you reach the end of it, the feeling of accomplishment will be the only thing to last. The green course is our recommendation for intermediate-level adventurers, who seek a nice adrenaline boost to snack on.', 1, '2022-02-28 11:26:40', '2022-02-28 11:26:40'),
(4, 'EXPERT', 'assets/uploads/offers_items/68641646047669.jpg', 'For the tough ones who don’t settle for the least, this would be your true Everest to climb. The Red course has claimed its color from the extent of its ultimatum. Are you brave enough to walk on some wooden logs supported with nothing but a pair of ropes, or hang on a climbing wall at a height of around 30 meters? One thing is certain to be said, this course is not for the faint-hearted, but once you get it over with, nothing more can stand in your way.', 1, '2022-02-28 11:27:49', '2022-02-28 11:27:49'),
(5, 'FOOD-CARTS', 'assets/uploads/offers_items/6201646047743.jpg', 'Buckle up and prepare for the perfect Birthday celebration that you or your beloved kids will definitely cherish. Get in touch and let our specialized team assist you in organizing a memorable day that will leave nothing unaccounted for. Starting from the cake, decorations, activations, music, and the thrill adventures of Sky Park, of course.', 2, '2022-02-28 11:29:03', '2022-02-28 11:29:03'),
(6, 'WEST-TOWN-HUB', 'assets/uploads/offers_items/63391646047788.jpg', 'Devour a box of Fried chicken or a juicy burger. Sky Park is located right next to West Town Hub at SODIC, 6th of October city. The Hub is SODIC’s dining area which boasts a set of the best-rated restaurants and coffee shops. You can grab a quick bite prior to going on your fun adventure or loading up afterward. Nothing makes an outing complete as a tasty meal among some nice company, combine that with the adrenaline-boosting experience of Sky Park and your day will just shine.', 2, '2022-02-28 11:29:48', '2022-02-28 11:29:48'),
(7, 'BIRTHDAYS', 'assets/uploads/offers_items/89121646048060.jpg', 'As Sky Park will push your energy savings to their minimum, you will definitely need to grab a bite in order to recharge. That’s why a snack cart is available to help you pack up those missing calories and get ready for another round on the high ropes. Don’t let the sound of your empty growling stomach last and grab yourself a pack of popcorn or a packet of freshly prepared chips seasoned to tingle your taste buds with the most cheerful flavors', 4, '2022-02-28 11:34:20', '2022-02-28 11:34:20'),
(8, 'CORPORATE-EVENTS', 'assets/uploads/offers_items/45791646048112.jpg', 'Do you think your team is exhausted from work and needs some refreshment to get back on the productivity track? Nothing achieves that better than going on a group adventure. Sky Park has it all planned for you with a space to customize your own package based on the number of your employees.', 4, '2022-02-28 11:35:12', '2022-02-28 11:35:12'),
(9, 'GROUPS', 'assets/uploads/offers_items/25281646048150.jpg', 'Get your friends and their families on board and set your sails towards Sky Park and don’t worry about your budget, we’ll take care of this for you', 4, '2022-02-28 11:35:50', '2022-02-28 11:35:50');
